import Slider from '@material-ui/core/Slider';

class PersonsCount extends Component {
    state = {
        x:0,
    }
    handleChange =()=>{
        this.setState({
            x: this.state+1
        })
    }

    render() {
        return <AppBar>
            <p>Hello</p>
            </AppBar>
    }
}

export default PersonsCount;
